// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "../library/StorageMapping.sol";

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
* @title MultiSender Token Tool
*
* Version v1.1.0
*
*/

contract MultiSenders is Ownable {
    using SafeMath for uint256;

    string public constant VERSION_NUMBER = "v1.0.1";

    struct TransferCount { uint256 price; uint256 count; }

    mapping (bytes32 => bool) private applys;
    mapping (uint256 => TransferCount) private transferCounts;

    event Purchased(uint256 price, uint256 count);
    event Multisent(uint256 count, uint256 amounts, uint256 fee);
    event Withdrawed(address receiver, uint256 amounts);

    constructor() {

    }

    receive() external payable { }

    function withdraw(address receiver, address token) external onlyOwner {
        uint256 balance = address(this).balance;

        if (token == address(0)) payable(receiver).transfer(address(this).balance);
        else IERC20(token).transfer(receiver, IERC20(token).balanceOf(address(this)));

        emit Withdrawed(receiver, balance);
    }

    function multisendEther(
        address[] memory payees, uint256[] memory amounts
    ) external payable {
        uint256 totalAmount = 0; uint256 fee = 0;

        for (uint256 index = 0; index < payees.length; index++) {
            payable(payees[index]).transfer(amounts[index]);
            totalAmount = totalAmount.add(amounts[index]);
        }

        emit Multisent(payees.length, msg.value.sub(fee), fee);
    }

    function multisendERC20(
        address token, address[] memory payees, uint256[] memory amounts
    ) external {
        require(payees.length == amounts.length, "INVALID");
        IERC20 multiToken = IERC20(token);
        uint256 totalAmount = 0; uint256 fee = 0;

        for (uint256 index = 0; index < payees.length; index++) {
            bool isSuccess = multiToken.transferFrom(
                msg.sender, payees[index], amounts[index]
            );

            require(isSuccess, "TRANSFER_FAILD");
            totalAmount = totalAmount.add(amounts[index]);
        }

        emit Multisent(payees.length, totalAmount, fee);
    }
}
